        src="/dumpTRUCKlogo.svg"
      />
      <hr />
      {props.children}
    </div>
    <style jsx>{`
      .layout {
        // margin: 20 !important;
        // padding: 20;
      }
    `}</style>
  </div>
);

export default Header;
